[720p] Neighbor Affair - Breanne  Benson

Released: July 14, 2011

Alex is new to the neighborhood, so he brings a pot of sugar over to his hot neighbor Breanne as a gift. He tells her that in his native country, the new neighbor usually receives a gift, as well. Embarrassed that she doesn\'t have much to offer him, Breanne gets creative and illustrates her hospitality in other ways: by getting naked and sucking and fucking his big dick until he splooges all over her mouth. Talk about getting some sugar from your neighbor!
